import i18next from 'i18next';
import Travels from './Travels';
import en from './i18n/en';
import tr from './i18n/tr';
import ar from './i18n/ar';
import es from './i18n/es';

i18next.addResourceBundle('en', 'travelsPage', en);
i18next.addResourceBundle('tr', 'travelsPage', tr);
i18next.addResourceBundle('ar', 'travelsPage', ar);
i18next.addResourceBundle('es', 'travelsPage', es);

const TravelsConfig = {
  settings: {
    layout: {
      config: {},
    },
  },
  routes: [
    {
      path: '/travels',
      component: Travels,
    },
  ],
};

export default TravelsConfig;

/**
 * Lazy load Example
 */
